import React from 'react';


function Balance({totalIncome, totalExpense}){

    return (
        <div>
            <h5>Balance</h5>
            <div>Total Income :{totalIncome.monthlyTotalIncome}</div>
            <div>Total Expense :{totalExpense.monthlyTotalExpense}</div>
        </div>
    )

}

export default Balance;
